member.summary:
Provides the configuration for logging a type of permissions. Example:

             { "audit_log_configs": [ { "log_type": "DATA_READ", "exempted_members": [ "user:foo@gmail.com" ] }, {
             "log_type": "DATA_WRITE", } ] }

             This enables 'DATA_READ' and 'DATA_WRITE' logging, while exempting foo@gmail.com from DATA_READ
             logging.

Assigns a name to a port number. For example: {name: "http", port: 80}
This allows the system to reference ports by the assigned name instead of a port number. Named ports can also contain multiple ports. For example: [{name: "http", port: 80},{name: "http", port: 8080}]
Named ports apply to all instances in this instance group.
